import React from 'react'

const Display=(props)=> {

    const FinalResult=({ emp })=>
    {
            if( emp)
            {
                emp.map( (res,index)=>{
                    return(<ul key={index}>
                            <li>{res.id}</li>
                            <li>{res.name}</li>
                            <li>{res.email}</li>
                            <li>{res.phone}</li>
                    </ul>)
                })
            }
    }

    return (<>
            
            <div className="container py-5">
                        { FinalResult(props) }
            </div>

        </>)

}


export default Display
